enableBudgetExceedsBudget:"\u038c\u03c4\u03b1\u03bd \u03ad\u03bd\u03b1 \u03bc\u03ad\u03bb\u03bf\u03c2 \u03ad\u03c7\u03b5\u03b9 \u03ba\u03b1\u03c4\u03b1\u03bd\u03b1\u03bb\u03ce\u03c3\u03b5\u03b9 \u03cc\u03bb\u03b5\u03c2 \u03c4\u03b9\u03c2 \u03bc\u03bf\u03bd\u03ac\u03b4\u03b5\u03c2 \u03ba\u03b1\u03c4\u03b1\u03bd\u03ac\u03bb\u03c9\u03c3\u03b7\u03c2 \u03c0\u03bf\u03c5 \u03c4\u03bf\u03c5 \u03ad\u03c7\u03bf\u03c5\u03bd \u03ba\u03b1\u03c4\u03b1\u03bd\u03b5\u03bc\u03b7\u03b8\u03b5\u03af, \u03c4\u03b1 \u03b5\u03ba\u03c7\u03c9\u03c1\u03b7\u03bc\u03ad\u03bd\u03b1 \u03b4\u03b9\u03ba\u03b1\u03b9\u03ce\u03bc\u03b1\u03c4\u03b1 \u03ba\u03b1\u03c4\u03b1\u03bd\u03ac\u03bb\u03c9\u03c3\u03b7\u03c2 \u03bc\u03bf\u03bd\u03ac\u03b4\u03c9\u03bd \u03b8\u03b1 \u03b1\u03bd\u03b1\u03c3\u03c4\u03b1\u03bb\u03bf\u03cd\u03bd \u03bc\u03ad\u03c7\u03c1\u03b9 \u03bd\u03b1 \u03c4\u03bf\u03c5\u03c2 \u03ba\u03b1\u03c4\u03b1\u03bd\u03b5\u03bc\u03b7\u03b8\u03bf\u03cd\u03bd \u03c0\u03c1\u03cc\u03c3\u03b8\u03b5\u03c4\u03b5\u03c2 \u03bc\u03bf\u03bd\u03ac\u03b4\u03b5\u03c2.",
